/*Table structure for table `apply` */

DROP TABLE IF EXISTS `apply`;

CREATE TABLE `apply` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `addTime` varchar(45) DEFAULT NULL COMMENT '添加时间',
  `updateTime` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '修改时间',
  `bxdId` int(4) NOT NULL COMMENT '报销单id',
  `priceInfo` varchar(45) DEFAULT NULL COMMENT '费用明细',
  `financeNum` varchar(45) DEFAULT NULL COMMENT '财务部门编码',
  `priceFrom` int(4) DEFAULT NULL COMMENT '经费来源 1、当年财政拨款   2、以前年度财政拨款结转 3、以前年度财政拨款结余',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

