/*Table structure for table `apply_flow` */

DROP TABLE IF EXISTS `apply_flow`;

CREATE TABLE `apply_flow` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `appid` int(4) NOT NULL COMMENT '报销单id',
  `submit` int(4) NOT NULL DEFAULT '1' COMMENT '0 已提交 1待提交',
  `oneApprove` int(4) NOT NULL DEFAULT '0' COMMENT '0 默认 1待审批1 9干掉',
  `twoApprove` int(4) NOT NULL DEFAULT '0' COMMENT '0 默认 1待审批2 9干掉',
  `threeApprove` int(4) NOT NULL DEFAULT '0' COMMENT '0 默认 1待审批3 9干掉',
  `sign` int(4) NOT NULL DEFAULT '0' COMMENT '0 默认 1 待签字',
  `oneSign` int(4) DEFAULT '0' COMMENT '0 默认 1 拒签1 9干掉',
  `twoSign` int(4) DEFAULT '0' COMMENT '0 默认 1 拒签2 9干掉',
  `threeSign` int(4) DEFAULT '0' COMMENT '0 默认 1 拒签3 9干掉',
  `finance` int(4) DEFAULT '0' COMMENT '0默认 1已审批  财务审批',
  `did` int(4) NOT NULL DEFAULT '1' COMMENT '单位id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=435 DEFAULT CHARSET=utf8;

