/*Table structure for table `bxd` */

DROP TABLE IF EXISTS `bxd`;

CREATE TABLE `bxd` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `applyNo` varchar(45) NOT NULL DEFAULT 'b' COMMENT '报销单号',
  `typeNo` varchar(20) DEFAULT NULL COMMENT '类型编号',
