/*Table structure for table `send_bank` */

DROP TABLE IF EXISTS `send_bank`;

CREATE TABLE `send_bank` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `TransCode` varchar(50) NOT NULL DEFAULT '' COMMENT '交易码',
  `BatchID` varchar(50) NOT NULL DEFAULT '' COMMENT '交易流水号, 上送报文为BatchID防止重复提交用',
  `JnlDate` char(8) NOT NULL DEFAULT '' COMMENT '请求日期',
  `JnlTime` char(6) NOT NULL DEFAULT '' COMMENT '请求时间',
  `ClientPatchID` varchar(50) NOT NULL DEFAULT '' COMMENT '客户端批内序号/客户交易号',
  `transferType` char(4) NOT NULL DEFAULT '2122' COMMENT '转帐类型（行内转账2122/对外转帐2120/跨行转账2144）',
  `beyondDealFlag` char(1) DEFAULT '' COMMENT '0-超限额提示 1超额继续交易',
  `accountNo` varchar(21) NOT NULL DEFAULT '' COMMENT '光大银行账户，17或者21位数字，转出账号',
  `toAccountName` varchar(62) NOT NULL DEFAULT '' COMMENT '汇入帐户名称/收款人帐户名称',
  `toAccountNo` varchar(30) NOT NULL DEFAULT '' COMMENT '汇入帐户号/收款人帐户号',
  `toBank` varchar(62) NOT NULL DEFAULT '' COMMENT '汇入银行名称/收款人帐户开户行名称',
  `amount` decimal(13,2) NOT NULL DEFAULT '0.00' COMMENT '余额/发生额',
  `toLocation` varchar(62) DEFAULT '' COMMENT '汇入省市',
  `clientSignature` varchar(10) DEFAULT '' COMMENT '客户签名',
  `checkNo` varchar(32) DEFAULT '' COMMENT '支票号',
  `checkPassword` varchar(6) DEFAULT '' COMMENT '支票密码',
  `note` varchar(128) NOT NULL DEFAULT '' COMMENT '转帐用途',
  `noteOther` varchar(128) NOT NULL DEFAULT '' COMMENT '用途备注',
  `bankNo` varchar(12) DEFAULT '' COMMENT '联行号',
  `isUrgent` char(1) NOT NULL DEFAULT '1' COMMENT '加急标志 0不加急 1加急',
  `cellphone` varchar(20) DEFAULT '' COMMENT '手机号',
  `perOrEnt` char(1) NOT NULL DEFAULT '0' COMMENT '收款账户对公对私标志  0对公 1对私',
  `IsAudit` char(1) DEFAULT '' COMMENT '银行审核标志 1表示需要银行审核；0或者空表示不需要银行审核。',
  `matchRule` char(1) DEFAULT '' COMMENT '联行号匹配规则 默认就可以',
  `bxdId` int(11) NOT NULL DEFAULT '0' COMMENT '报销单id',
  `itemNo` varchar(45) NOT NULL DEFAULT '' COMMENT '课题号',
  `ReturnCode` varchar(9) NOT NULL DEFAULT '' COMMENT '响应码元素返回交易处理状态码',
  `ReturnMsg` varchar(256) NOT NULL DEFAULT '' COMMENT '响应信息元素交易处理状态中文信息',
  `ReturnNote` varchar(256) NOT NULL DEFAULT '' COMMENT '备注',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=29 DEFAULT CHARSET=utf8;

