/*Table structure for table `t_bx_d_clfbxdj` */

DROP TABLE IF EXISTS `t_bx_d_clfbxdj`;

CREATE TABLE `t_bx_d_clfbxdj` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `DJBH` varchar(64) NOT NULL DEFAULT '' COMMENT '单据编号',
  `BXDBH` varchar(45) NOT NULL DEFAULT '' COMMENT '报销单编号',
  `ZKMBM` varchar(20) DEFAULT '' COMMENT '子科目编码',
  `CCRBM` varchar(20) DEFAULT '' COMMENT '出差人编码',
  `CCLB` int(4) DEFAULT '55' COMMENT '2 火车 3 飞机',
  `MDD` varchar(20) DEFAULT '' COMMENT '目的地',
  `CFSJ` date DEFAULT NULL COMMENT '出发时间',
  `FHSJ` date DEFAULT NULL COMMENT '返回时间',
  `JTGZBM` varchar(20) DEFAULT '' COMMENT '交通工具编码 8 火车+轮船 1 飞机 4 轮船 2 火车 3	汽车 5 出租车 6	飞机+火车 7 飞机+轮船',
  `JTFY` decimal(10,2) DEFAULT '0.00' COMMENT '交通费用',
  `ZSF` decimal(10,2) DEFAULT '0.00' COMMENT '住宿费',
  `ZF` decimal(10,2) DEFAULT '0.00' COMMENT '杂费',
  `CCBZ` decimal(10,2) DEFAULT '0.00' COMMENT '出差补助',
  `HCTB` decimal(10,2) DEFAULT '0.00' COMMENT '火车特补',
  `TQTLSJ` varchar(45) DEFAULT '' COMMENT '特区停留时间',
  `SM` varchar(1000) DEFAULT '' COMMENT '说明',
  `BZ` varchar(1000) DEFAULT '' COMMENT '备注',
  `CJR` varchar(20) DEFAULT '' COMMENT '创建人',
  `CJRQ` datetime DEFAULT NULL COMMENT '创建日期',
  `XGR` varchar(20) DEFAULT '' COMMENT '修改人',
  `XGRQ` datetime DEFAULT NULL COMMENT '修改日期',
  `SCBZ` varchar(1) DEFAULT '0' COMMENT '删除标志',
  `CWBMBM` varchar(20) DEFAULT '000000' COMMENT '财务部门编码',
  `JBBM` varchar(20) DEFAULT '55' COMMENT '级别编码',
  `JSR` varchar(20) DEFAULT '',
  `GZFBZ` decimal(10,2) DEFAULT '0.00',
  `CLRS` varchar(20) DEFAULT '1',
  `CONTENTXML` varchar(1000) DEFAULT '',
  `OPERATORID_CJR` varchar(20) DEFAULT '' COMMENT '创建人id',
  `OPERATORID_XGR` varchar(20) DEFAULT '' COMMENT '修改人id',
  `CCR` varchar(2000) DEFAULT '' COMMENT '出差人明细',
  `TQBZ` decimal(10,2) DEFAULT NULL COMMENT '特区补助',
  `JFLY` varchar(4) DEFAULT '' COMMENT '经费来源 1、当年财政拨款   2、以前年度财政拨款结转 3、以前年度财政拨款结余',
  `XZQYXX` varchar(100) DEFAULT '',
  `XZQHDM` varchar(100) DEFAULT '',
  `bxdId` int(4) NOT NULL DEFAULT '0' COMMENT '报销单id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=116 DEFAULT CHARSET=utf8;

