DROP TABLE IF EXISTS `t_bx_d_jtfbxdj`;

CREATE TABLE `t_bx_d_jtfbxdj` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `DJBH` varchar(64) NOT NULL DEFAULT '' COMMENT '单据编号',
  `BXDBH` varchar(20) DEFAULT '' COMMENT '报销单编号',
  `FYMX` varchar(20) DEFAULT '' COMMENT '费用明细',
  `BXRBM` varchar(240) DEFAULT '' COMMENT '报销人编码',
  `CCFY` decimal(5,2) DEFAULT NULL COMMENT '乘车费用',
  `SM` varchar(100) DEFAULT '' COMMENT '说明',
  `BZ` varchar(100) DEFAULT '' COMMENT '备注',
  `CJR` varchar(20) DEFAULT '' COMMENT '创建人',
  `CJRQ` datetime DEFAULT NULL COMMENT '创建日期',
  `XGR` varchar(20) DEFAULT '' COMMENT '修改人',
  `XGRQ` datetime DEFAULT NULL COMMENT '修改日期',
  `SCBZ` varchar(4) DEFAULT '0' COMMENT '删除标志',
  `CWBMBM` varchar(20) DEFAULT '0' COMMENT '财务部门编码',
  `CONTENTXML` text COMMENT 'xml格式数据',
  `JFLY` int(4) DEFAULT NULL COMMENT '经费来源 1、当年财政拨款   2、以前年度财政拨款结转 3、以前年度财政拨款结余',
  `bxdId` int(4) NOT NULL DEFAULT '0' COMMENT '报销单id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=215 DEFAULT CHARSET=utf8;

