/*Table structure for table `t_bx_d_ktftmx` */

DROP TABLE IF EXISTS `t_bx_d_ktftmx`;

CREATE TABLE `t_bx_d_ktftmx` (
  `FTBH` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `BXDBH` varchar(20) NOT NULL COMMENT '报销单生成编号',
  `DJBH` varchar(64) DEFAULT '' COMMENT '单据生成 uuid',
  `KTBH` varchar(45) DEFAULT '' COMMENT '课题编号',
  `FTJE` decimal(10,2) DEFAULT '0.00' COMMENT '金额',
  `BXDLXBM` varchar(4) DEFAULT 'BJT' COMMENT '报销类别,交通费为BJT,差旅费为BCC',
  `BZ` varchar(100) DEFAULT '',
  `CJR` varchar(20) DEFAULT '',
  `CJRQ` date DEFAULT NULL,
  `XGR` varchar(20) DEFAULT '',
  `XGRQ` date DEFAULT NULL,
  `SCBZ` varchar(1) DEFAULT '',
  `FYMX` varchar(20) DEFAULT '' COMMENT '科目,交通费为记账凭证上的固定编号',
  `SHKTBH` varchar(50) DEFAULT '',
  `ZBDW` varchar(50) DEFAULT '',
  `ZRKMBM` varchar(20) DEFAULT '',
  `ZRKTBH` varchar(20) DEFAULT '',
  `KMID` varchar(64) DEFAULT '',
  `JFLY` varchar(4) DEFAULT '',
  `ZZSJ` decimal(15,2) DEFAULT '0.00',
  `DFKT` varchar(100) DEFAULT '',
  PRIMARY KEY (`FTBH`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

/*Data for the table `t_bx_d_ktftmx` */

/*Table structure for table `ticket` */

DROP TABLE IF EXISTS `ticket`;

CREATE TABLE `ticket` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `ticketNo` varchar(20) NOT NULL COMMENT '发票单号',
  `userNumber` varchar(45) DEFAULT NULL COMMENT '报销人',
  `type` int(4) NOT NULL DEFAULT '0' COMMENT '1 出租车 2 火车 3 飞机 4 增值 5 电子 6 其他',
  `addTime` varchar(20) NOT NULL DEFAULT '0' COMMENT '添加时间',
  `updateTime` varchar(45) NOT NULL DEFAULT '0' COMMENT '修改时间',
  `status` int(4) NOT NULL DEFAULT '0' COMMENT '0 待审核 1已审核 2已驳回',
  `ticketNum` varchar(45) DEFAULT NULL COMMENT '发票唯一单号(长)',
  `uid` int(4) DEFAULT '0' COMMENT '用户id',
  `price` decimal(15,2) NOT NULL DEFAULT '0.00' COMMENT '金额',
  `save` int(4) NOT NULL DEFAULT '0' COMMENT '0未保存 1 以保存',
  `timanage` int(4) NOT NULL DEFAULT '0' COMMENT '信息0未处理 1 已处理',
  `tamanage` int(4) NOT NULL DEFAULT '0' COMMENT '报销0未审核 1通过 2不通过',
  `ttmanage` int(4) NOT NULL DEFAULT '0' COMMENT '票据 0未处理 1已通过 2未通过',
  `explain` text COMMENT '不合格说明',
  `image` varchar(255) DEFAULT NULL COMMENT '图片',
  `applyNo` varchar(45) NOT NULL DEFAULT 'b' COMMENT '报销单号',
  `applyPass` int(4) NOT NULL DEFAULT '0' COMMENT '报销单 0待审核 已审核1 已驳回2',
  `apExplain` text COMMENT '报销单说明',
  `apprice` decimal(5,2) DEFAULT '0.00' COMMENT '报销单价格',
  `itemNo` varchar(45) DEFAULT NULL COMMENT '课题号',
  `tappId` int(4) NOT NULL DEFAULT '0' COMMENT '报销单id',
  `recogn` int(4) NOT NULL DEFAULT '1' COMMENT '0 拒识 1识别 2人工',
  `tid` int(4) NOT NULL DEFAULT '0' COMMENT '票据唯一标识  id用删除',
  `accImage` varchar(225) NOT NULL DEFAULT '0' COMMENT '附件地址 0 没有附件',
  `accExplain` varchar(225) DEFAULT NULL COMMENT '附件说明',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3347 DEFAULT CHARSET=utf8;

