/*Table structure for table `ticket_e` */

DROP TABLE IF EXISTS `ticket_e`;

CREATE TABLE `ticket_e` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `eCode` varchar(20) NOT NULL COMMENT '发票代码',
  `eSum` varchar(30) NOT NULL COMMENT '金额',
  `eUname` varchar(30) NOT NULL COMMENT '报销人',
  `eTname` varchar(30) NOT NULL COMMENT '票据名称',
  `pid` varchar(10) CHARACTER SET latin1 DEFAULT NULL,
  `eNumber` varchar(45) CHARACTER SET latin1 DEFAULT NULL COMMENT '发票号码',
  `eTime` varchar(45) CHARACTER SET latin1 DEFAULT NULL COMMENT '日期',
  `ebuyNo` int(20) NOT NULL DEFAULT '0' COMMENT '买家识别号',
  `esellNo` int(20) NOT NULL DEFAULT '0' COMMENT '卖家识别号',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=14 DEFAULT CHARSET=utf8;

