/*Table structure for table `ticket_other` */

DROP TABLE IF EXISTS `ticket_other`;

CREATE TABLE `ticket_other` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `oCode` varchar(20) NOT NULL COMMENT '发票代码',
  `othersum` varchar(30) NOT NULL,
  `otherUname` varchar(30) NOT NULL,
  `otherTname` varchar(30) NOT NULL,
  `pid` int(10) DEFAULT NULL,
  `oNumber` varchar(255) CHARACTER SET latin1 NOT NULL COMMENT '发票号码',
  `oTime` varchar(255) CHARACTER SET latin1 NOT NULL COMMENT '日期',
  `obuyNo` int(45) NOT NULL DEFAULT '0' COMMENT '买家识别号',
  `osellNo` int(45) NOT NULL DEFAULT '0' COMMENT '卖家识别号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

