/*Table structure for table `ticket_plane` */

DROP TABLE IF EXISTS `ticket_plane`;

CREATE TABLE `ticket_plane` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `planeNumber` varchar(20) NOT NULL DEFAULT '0' COMMENT '航班号',
  `planeUname` varchar(30) DEFAULT '0' COMMENT '乘客姓名',
  `planeSlocation` varchar(45) DEFAULT '0' COMMENT '起始地点',
  `planeElocation` varchar(45) DEFAULT '0' COMMENT '目的地',
  `planedate` varchar(100) NOT NULL DEFAULT '0' COMMENT '日期',
  `planelevel` varchar(30) NOT NULL DEFAULT '0' COMMENT '级别',
  `pid` int(4) DEFAULT '0' COMMENT '上级id',
  `purchase` varchar(45) NOT NULL DEFAULT '0' COMMENT '政府采购码',
  `printing` varchar(45) NOT NULL DEFAULT '0' COMMENT '印刷序号',
  `passengerNo` varchar(45) NOT NULL DEFAULT '0' COMMENT '电子客票号',
  `planeInsurance` varchar(45) DEFAULT '0' COMMENT '保险',
  `planeTime` varchar(45) DEFAULT '0' COMMENT '时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=641 DEFAULT CHARSET=utf8;

