/*Table structure for table `ticket_train` */

DROP TABLE IF EXISTS `ticket_train`;

CREATE TABLE `ticket_train` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `trainUnumber` varchar(20) NOT NULL,
  `trainNum` varchar(45) NOT NULL COMMENT '火车车次',
  `trainlocation1` varchar(20) NOT NULL,
  `trainUname` varchar(45) NOT NULL COMMENT '乘客姓名',
