/*Table structure for table `ticket_vat` */

DROP TABLE IF EXISTS `ticket_vat`;

CREATE TABLE `ticket_vat` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `vatName` varchar(20) NOT NULL,
  `vatCode` varchar(30) NOT NULL COMMENT '发票代码',
  `vatLocation1` varchar(30) NOT NULL,
  `vatNumber` varchar(30) NOT NULL COMMENT '发票号码',
  `vatLocation2` varchar(30) NOT NULL,
  `vatSum` varchar(30) NOT NULL COMMENT '金额',
  `vatlocation3` varchar(30) NOT NULL,
  `vatState` int(10) DEFAULT NULL COMMENT '0:jushi,1:shibie,2:rengong',
  `pid` int(10) DEFAULT NULL,
  `vatTime` varchar(45) CHARACTER SET latin1 DEFAULT NULL COMMENT '日期',
  `vbuyNo` int(20) NOT NULL DEFAULT '0' COMMENT '买家识别号',
  `vsellNo` int(20) NOT NULL DEFAULT '0' COMMENT '卖家识别号',
  PRIMARY KEY (`id`)
) ENGINE=MyISAM AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

