/*Table structure for table `user` */

DROP TABLE IF EXISTS `user`;

CREATE TABLE `user` (
  `id` int(6) unsigned NOT NULL AUTO_INCREMENT,
  `name` varchar(30) DEFAULT NULL COMMENT '姓名',
  `num` varchar(30) DEFAULT NULL COMMENT '账号',
  `password` varchar(45) DEFAULT NULL COMMENT '密码',
  `rid` int(4) NOT NULL DEFAULT '0' COMMENT '权限',
  `bankcardNo` varchar(100) DEFAULT NULL COMMENT '银行卡号',
  `tel` bigint(40) DEFAULT NULL COMMENT '电话',
  `email` varchar(100) DEFAULT NULL COMMENT '邮箱',
  `job` varchar(45) DEFAULT NULL COMMENT '职务',
  `class` int(4) DEFAULT NULL COMMENT '课题组',
  `department` int(4) DEFAULT NULL COMMENT '部门',
  `company` int(4) DEFAULT NULL COMMENT '公司（科研机构名称)',
  `logo` varchar(100) DEFAULT NULL,
  `imanage` int(4) DEFAULT '0' COMMENT '信息 1办理 0未办理',
  `amanage` int(4) DEFAULT '0' COMMENT '报销 1办理 0未办理',
  `tmanage` int(4) DEFAULT '0' COMMENT '票据 1办理 0未办理',
  `identityNo` int(18) NOT NULL DEFAULT '0' COMMENT '身份证号',
  `token` varchar(20) NOT NULL COMMENT 'token验证',
  PRIMARY KEY (`id`),
  UNIQUE KEY `Number` (`num`)
