/*Table structure for table `voucher` */

DROP TABLE IF EXISTS `voucher`;

CREATE TABLE `voucher` (
  `id` int(4) NOT NULL AUTO_INCREMENT,
  `vouNo` varchar(20) NOT NULL DEFAULT '0' COMMENT '凭证编号',
  `addtime` date NOT NULL COMMENT '添加时间',
  `main` varchar(45) NOT NULL DEFAULT '' COMMENT '摘要',
  `passPerson` varchar(45) NOT NULL DEFAULT '' COMMENT '经手人',
  `vouInfo` varchar(255) NOT NULL DEFAULT '' COMMENT '账户信息',
  `borrowPrice` decimal(10,2) DEFAULT NULL COMMENT '借方金额',
  `loanPrice` decimal(10,2) DEFAULT NULL COMMENT '贷方金额',
  `allPrice` decimal(10,2) NOT NULL DEFAULT '0.00' COMMENT '合计',
  `finance` varchar(45) NOT NULL DEFAULT '李玉洁' COMMENT '财务负责人',
  `cashier` varchar(45) NOT NULL DEFAULT '梁婧' COMMENT '出纳',
  `accreditation` varchar(45) NOT NULL DEFAULT '邹爱华' COMMENT '制证',
  `bid` int(4) NOT NULL DEFAULT '0' COMMENT '报销单id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=55 DEFAULT CHARSET=utf8;

